import { createSlice, createSelector } from 'redux-starter-kit';

const initialState = {
  weight: [
    {
      date: 1562783942272,
      measurement: 160
    },
    {
      date: 1562797642272,
      measurement: 190
    },
    {
      date: 1562123042272,
      measurement: 80
    },
    {
      date: 1562782452272,
      measurement: 480
    }
  ],
  waist: [
    {
      date: 1562783942272,
      measurement: 60
    },
    {
      date: 1562797642272,
      measurement: 90
    },
    {
      date: 1562123042272,
      measurement: 30
    },
    {
      date: 1562782452272,
      measurement: 80
    }
  ]
}

const measurementHistory = createSlice({
  slice: 'measurementHistory',
  initialState: initialState,
  reducers: {
  }
});

const { actions, reducer } = measurementHistory;
export { actions as measurementHistoryActions };
export default reducer;
